import React from 'react';
import { Nav, Navbar, Alert } from 'react-bootstrap';
import { withRouter } from "react-router";

export const NavigationBar = () => (
<>
    <Navbar bg="dark" variant="dark">
        <Navbar.Brand href="/">Patrick Leduc</Navbar.Brand>
        <Nav className="mr-auto">
            <Nav.Link href="/experience">Experience</Nav.Link>
            <Nav.Link href="/projects">Projects</Nav.Link>
            <Nav.Link href="/education">Education</Nav.Link>
            <Nav.Link href="/contact">Contact</Nav.Link>
            <Nav.Link href="/blog">Blog</Nav.Link>
        </Nav>
    </Navbar>
    <Alert variant="primary">
        <p> This website runs on a Kubernetes Cluster! </p>
    </Alert>
</>
);

export const HeaderWithRouter = withRouter(Header);

export const Home = () => <AboutMe/>;
export const Education = () => <CardList classlist ={this.state.classlist}/>;
